// src/pages/YoungAdultMinistry.js
import React from 'react';

const YoungAdultMinistry = () => {
  return (
    <div>
      <h1>YoungAdult Ministry</h1>
      <p>Welcome to the Young AdultMinistry.</p>
      <p> Focuses on the spiritual and professional development of young adults and professionals, helping them navigate the challenges of early adulthood and career.
      .</p>
    </div>
  );
};

export default YoungAdultMinistry;
